import './App.css';
import { ResponsiveContainer, Linechart, Line } from 'recharts';

const data = [
  {
    name: 'Python',
    student: 13,
    fees: 10
  },
  {
    name: 'NodeJs',
    student: 25,
    fees: 15
  },
  {
    name: 'TypeScript',
    student: 30,
    fees: 23
  },
  {
    name: 'Java',
    student: 40,
    fees: 30
  },

]

function App() {
  return (
    <>
    <h1 className='chart-heading'>Line Chart</h1>
    <ResponsiveContainer width="100%" aspect={3}>
      <Linechart data={data}>
        <Line dataKey= "student" />
      </Linechart>
    </ResponsiveContainer>
    </>
  );
}

export default App;
